import React from 'react';
import { decode, Html5Entities } from 'html-entities';

export default function Quiz(props){
    const htmlEntities = new Html5Entities();

    const quizes = props.quizData.map(item => {
        return(
            <div className='quiz-container'>
                <h2 className='quiz-question'>{htmlEntities.decode(item.question)}</h2>
                <ul>
                    <li className='quiz-ans'>{htmlEntities.decode(item.incorrect_answers)}</li>
                    <li className='quiz-ans'>{htmlEntities.decode(item.correct_answer)}</li>
                </ul>
                <hr />
            </div>
        )
    })
    return(
        <div className='quizes-container'>
            {quizes}
        </div>
    )
}
